column16:
1 - Preencha seus parâmetros operacionais nos campos “meta”, "mesa" e “drawdown” que definiu no seu plano de trading;
2 - Estabeleça o percentual de “drawdown diário” em conformidade com seu planejamento operacional;
3 - Antes de iniciar suas operações do dia, preencha o campo “dias operados” conforme o sequencial dos seus dias já trabalhados;
4 - Ao lançar valores negativos em células de valores financeiros, SEMPRE coloque o sinal matemático de subtração ( - ) ANTES dos valores;
5 - LEMBRE-SE: A eficiência da planilha DEPENDE da correta inserção das informações nas células correspondentes.
